contracts/Found.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.8.2 <0.9.0;

contract CrowdFunding {

    enum State {Active, Inactive}

    struct Project {
        string projectId;
        string projectName;
        string projectDescription;
        State projectState;
        uint currentFunds;
        uint256 goalFunds;
        address payable owner;
    }

    Project private project;

    constructor (string memory _projectId, string memory _projectName, string memory _projectDescription, uint256 _goalFounds){
        project = Project(
            _projectId, _projectName, _projectDescription, State.Active, 0, _goalFounds, payable(msg.sender)
        );
    }

    event FundingProject(
        address funder, uint value, uint currentFunds
    );

    error GoalReached(string description, uint256 goal);

    function fundProject() public payable notOwner {
        require(getStatus() == State.Active, "Crowd is not active");
        require(msg.value > 0, "Can't fund less than 0 ETH");
        if(project.currentFunds < project.goalFunds) {
            project.owner.transfer(msg.value);
            project.currentFunds += msg.value;
            emit FundingProject(msg.sender, msg.value, project.currentFunds);
        } else {
            revert GoalReached("The goal is reached", project.goalFunds);
        }
    }

    modifier notOwner() {
        require(project.owner != msg.sender, "The project owner can't do this transaction");
        _;
    }

    modifier onlyOwner() {
        require(project.owner == msg.sender, "You must be the project owner");
        _;
    }

    event ChangeStatus(address editor, State currentStatus);

    function changeState(State newState) public onlyOwner {
        project.projectState = newState; 
        emit ChangeStatus(msg.sender, project.projectState);
    }
    
    function getGoal() public view returns(uint) {
        return project.goalFunds;
    }
    
    function getStatus() public view returns(State) {
        return project.projectState;
    }
    
    function getFunds() public view returns (uint) {
        return project.currentFunds;
    }
}

